webpackJsonp([0x5db0c6275330],{8273:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"I am not an Expat Blogger 8: Sexual Orientation",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-8-sexual-orientation/",tags:"Y2012"},html:"<p><strong>I am not gay.</strong> Well, most expat bloggers aren't either, but there's a fair number who are. Must have something to do with the fact that you can marry who you want here.</p>\n<p>(part of a <a href=\"http://www.papascott.de/archives/category/not-an-expat-blogger/\">series</a>)</p>"},next:{fields:{title:"I am not an Expat Blogger 7: Food",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-7-food/"}},previous:{fields:{title:"Travel Blog",date:"16 Aug 2012",slug:"/2012-08-16-travel-blog/"}}},{node:{fields:{title:"I am not an Expat Blogger 7: Food",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-7-food/",tags:"Y2012"},html:"<p>(Note: the name of the series has been updated to more accurately reflect the spirit in which it's intended.)</p>\n<p><strong>I don't miss American food.</strong> It seems every expat blogger goes through a phase where they're missing some type of food from home, usually something heavily processed and extremely unhealthy. Comfort food. Some expats never snap out of it.</p>\n<p>Maybe it's because our business is food (my wife says to add that you're all welcome to buy all the comfort food you want from us!), or because I learned economics and understand supply and demand, but I was never all that emotionally attached to food from home. If there's something you miss, learn to make it (or a close approximation) yourself.</p>\n<p>And you can find peanut butter and Oreos at pretty much any German supermarket these days.</p>\n<p>(part of a <a href=\"http://www.papascott.de/archives/category/not-an-expat-blogger/\">series</a>)</p>"},next:{fields:{title:"I am not an Expat Blogger 6: Beer",date:"25 Jul 2012",slug:"/2012-07-25-i-am-not-an-expat-6-beer/"}},previous:{fields:{title:"I am not an Expat Blogger 8: Sexual Orientation",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-8-sexual-orientation/"}}},{node:{fields:{title:"I am not an Expat Blogger 6: Beer",date:"25 Jul 2012",slug:"/2012-07-25-i-am-not-an-expat-6-beer/",tags:"Y2012"},html:"<p><strong>I don't drink beer.</strong> Well, not much anyway. We used to, but we've now switched to wine.</p>\n<p>(part of a <a href=\"http://www.papascott.de/archives/category/not-an-expat/\">series</a>)</p>"},next:{fields:{title:"I am not an Expat Blogger 5: Public Transportation",date:"24 Jul 2012",slug:"/2012-07-24-i-am-not-an-expat-blogger-5-public-transportation/"}},previous:{fields:{title:"I am not an Expat Blogger 7: Food",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-7-food/"}}}],pathPrefix:"",first:!1,last:!1,index:21,pageCount:1101}}}});
